REPLACE INTO `p8_label` VALUES ('14434','cms','','','','','','school805_index_con5','html','a:4:{s:7:\"bgcolor\";s:0:\"\";s:13:\"allowed_roles\";a:0:{}s:18:\"place_holder_width\";s:2:\"60\";s:19:\"place_holder_height\";s:2:\"20\";}','<p>1959年，我校诞生于一片棉花地。初创时期，3排平房，5个教学班，十几名教师，200余名学生。经过六十年的艰苦奋斗、历代传承，学校规模不断发展壮大。如今有淮海路、健康路两个校区，占地4.5万平方米，建筑面积达5万平方米，现有100个教学班，在校学生5000余人，教职工300余人。学校办学设施一流，建成智慧校园管理系统，鸾娃电视台、智慧教室、校园网、交互式白板等现代化设备，有效推动了课程建设和学科融合。2013年起，学校对两个校区进行重新规划建设，并配备学生阅览室、创客教室、陶泥教室、书法教室等十多个专用教室，真正实现了教育硬件的“现代化”。</p>\r\n<p>我校秉承“求真”校训，本真教育”的办学主张，并推行本真课程体系.......<a href=\"#\">详细 >></a></p>','$label[school805_index_con5]','0','1575855095','1583371395','300','index');
