REPLACE INTO `p8_label` VALUES ('18606','sites','letter','jy07','','','','hdjl-letter_top','html','a:4:{s:7:\"bgcolor\";s:0:\"\";s:13:\"allowed_roles\";a:0:{}s:18:\"place_holder_width\";s:2:\"60\";s:19:\"place_holder_height\";s:2:\"20\";}','<span style=\"color: rgb(178, 34, 34);\"><strong>写信注意事项：</strong></span><br />\r\n<p>\r\n	1.投诉人真实姓名、电子邮件、电话（一定要有区号，最好留手机号码）。以方便我们及时与您联系。<br />\r\n	2.投诉信息中，可填写详细的被投诉对象名称、联系方式，方便我们快速受理跟进。<br />\r\n	3.在具体内容中，应写明投诉事件发生发经过，包括时间、地点和当事人（包括被投诉方）；说明明你的投诉要求。<br />\r\n	4.不允许发表任何非法的、骚扰性的、中伤他人的、伤害性的、庸俗的，淫秽等信息资料。</p>\r\n','$label[hdjl-letter_top]','0','1427613846','1486732229','300','');
