REPLACE INTO `p8_label` VALUES ('19851','sites','','jy11','','','','jy01_green_box2_con1','html','a:4:{s:7:\"bgcolor\";s:0:\"\";s:13:\"allowed_roles\";a:0:{}s:18:\"place_holder_width\";s:2:\"43\";s:19:\"place_holder_height\";s:2:\"12\";}','<p>院幼儿园拥有一流的硬件环境。幼儿园占地约1.5万平方米，建筑面积8900多平方米，广场面积约7200平方米，绿地面积约6000平方米，规划16个班，可容纳近500名儿童。园舍的外形宛若一架钢琴，优雅稳重，而五彩纷呈的外墙则尽显童趣盎然。园内设有创意美劳室科学发现室、角色游戏室、建构游戏室等完备的功能室，更有恒温游泳池可供幼儿戏水；室外设有玩沙池、开心农场等，海洋主题的塑胶操场上分布着各种户外游乐器械，是幼儿的游乐天堂。</p>','$label[jy01_green_box2_con1]','0','1578975329','1584065236','300','');
